import React, { useState, useEffect } from "react";
import "./CoffeeMug.css";

const CoffeeMug = ({ mouseX, mouseY, onClick }) => {
  const [spill, setSpill] = useState(false);

  useEffect(() => {
    // Add logic to determine spill based on motion
    const isMoving = spillMotionCheck(); // Implement spillMotionCheck function
    setSpill(isMoving);
  }, [mouseX, mouseY]);

  const spillMotionCheck = () => {
    // Implement your logic to determine motion and spill here
    // For simplicity, always spill for this example
    return true;
  };

  return (
    <div className={`coffee-mug ${spill ? "spill" : ""}`} onClick={onClick}>
      <div className="coffee"></div>
    </div>
  );
};

export default CoffeeMug;
